import React from 'react';
import { Box, Typography, IconButton, Stack, Link } from '@mui/material';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import EmailIcon from '@mui/icons-material/Email';
import PhoneIcon from '@mui/icons-material/Phone';

const Contact = () => {
  return (
    <Box
      sx={{
        textAlign: 'center',
        py: 6,
        px: 2,
      }}
    >
      <Typography variant="h4" fontWeight="bold" gutterBottom>
        İletişim
      </Typography>

      <Stack direction="row" spacing={6} justifyContent="center" my={4}>
        <Link
          href="https://www.linkedin.com/in/simsekyakup/"
          target="_blank"
          rel="noopener"
          underline="none"
        >
          <IconButton
            sx={{
              fontSize: 40,
              color: '#90caf9',
              transition: '0.3s',
              '&:hover': {
                textShadow: '0 0 8px #90caf9, 0 0 12px #64b5f6',
                color: '#ffffff',
              },
            }}
          >
            <LinkedInIcon fontSize="inherit" />
          </IconButton>
        </Link>

        <Link href="mailto:yakupsimseke@gmail.com" underline="none">
          <IconButton
            sx={{
              fontSize: 80,
              color: '#90caf9',
              transition: '0.3s',
              '&:hover': {
                textShadow: '0 0 8px #90caf9, 0 0 12px #64b5f6',
                color: '#ffffff',
              },
            }}
          >
            <EmailIcon fontSize="inherit" />
          </IconButton>
        </Link>

        <Link href="tel:+5309760393" underline="none">
          <IconButton
            sx={{
              fontSize: 40,
              color: '#90caf9',
              transition: '0.3s',
              '&:hover': {
                textShadow: '0 0 8px #90caf9, 0 0 12px #64b5f6',
                color: '#ffffff',
              },
            }}
          >
            <PhoneIcon fontSize="inherit" />
          </IconButton>
        </Link>
      </Stack>

      <Typography variant="body1" mt={6}>
        <Link
          href="/cv.pdf"
          download
          underline="hover"
          sx={{ fontWeight: 'bold', color: '#1976d2' }}
        >
          CV için tıklayınız
        </Link>
      </Typography>
    </Box>
  );
};

export default Contact;
